	add("breadwinning", "{\"term\":\"breadwinning\", \"etymology\":{\"influencers\":[{},{}], \"languages\":[\"West Frisian\", \"Dutch\"], \"text\":\"From {{compound|bread|winning|lang\u003den}}. Compare West frisian \u0027breawinning\u0027 (livelihood) Dutch \u0027broodwinning\u0027 (profession)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The earning of a household\u0027s primary income\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2007\u0027\u0027, Angela Hattery, Earl Smith, \u0027African American families\u0027 (page 104\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"And the key issues that both batterers and battered women identify as triggers to battering are men\u0027s successes in \u0027\u0027breadwinning\u0027\u0027 and the bedroom – the two Bs\", \"priority\":3}]}, \"synonyms\":{}}");

	add("breaker", "{\"term\":\"breaker\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|break|er|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Something that breaks\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A machine for breaking rocks, or for breaking coal at the mine\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The building in which such a machine is placed\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A small cask of liquid kept permanently in a ship\u0027s boat in case of shipwreck\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1898\u0027\u0027, Chapter\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Then the conversation broke off, and there was little more talking, only a noise of men going backwards and forwards, and of putting down of kegs and the hollow gurgle of good liquor being poured from \u0027\u0027breakers\u0027\u0027 into the casks\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A person who specializes in breaking things\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A wave breaking into foam against the shore, or against a sand bank, or a rock or reef near the surface, considered a useful warning to ships of an underwater hazar\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"1919\u0027\u0027, w:William Somerset W. Somerset Maugham, \u0027w:The Moon and The Moon and Sixpence\u0027, s:The Moon and Sixpence/Chapter chapter 5\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Now and then in the lagoon you hear the leaping of a fish [...]. And above all, ceaseless like time, is the dull roar of the \u0027\u0027breakers\u0027\u0027 on the reef\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"1979\u0027\u0027, Stan Rogers, \u0027The Flowers of Bermuda\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"There came a cry: Oh, there be \u0027\u0027breakers\u0027\u0027 dead ahead! / From the collier, Nightingale\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"A breakdancer\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"A user of CB radio\", \"priority\":14}]}, \"synonyms\":{}}");

	add("breakfast", "{\"term\":\"breakfast\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From \u0027\u0027 + \u0027\u0027 to end the nightly fast.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The first meal of the day, usually eaten in the morning\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"You should put more protein in her \u0027\u0027breakfast\u0027\u0027 so she will grow\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1591\u0027\u0027, Shakespeare, \u0027Henry VI, part 2\u0027, act 1\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"a sorry \u0027\u0027breakfast\u0027\u0027 for my lord protecto\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A meal consisting of food normally eaten in the morning, which may typically include eggs, sausages, toast, bacon, etc\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"We serve \u0027\u0027breakfast\u0027\u0027 all day\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A meal eaten after a period of (now often religious) fasting\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"The wolves will get a \u0027\u0027breakfast\u0027\u0027 by my death\", \"priority\":8}]}, \"synonyms\":{}}");

