	add("breast", "{\"term\":\"breast\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"English\", \"middle english (1100-1500)\"], \"text\":\"From Middle english (1100-1500) \u0027brest\u0027 from Old english (ca. 450-1100) {{m|ang|brēost}}, from Proto-germanic {{m|gem-pro|*breustą}}, from Proto-indo-european {{m|ine-pro|*bʰrews-||to swell}}. Compare West Frisian {{m|fy|boarst}}, Danish {{m|da|bryst}}, Swedish {{m|sv|bröst}}; cf. also Dutch {{m|nl|borst}}, German {{m|de|Brust}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"File:Illu breast thumb|A breas\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Either of the two organs on the front of a woman\u0027s chest, which contain the mammary glands; also the analogous organs in men\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Tanya\u0027s \u0027\u0027breasts\u0027\u0027 grew alarmingly during pregnancy\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The chest, or front of the human thorax\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1798\u0027\u0027, \u0026quot;The Rime of the Ancient Mariner\u0026quot\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The Wedding-Guest here beat his \u0027\u0027breast\u0027\u0027, For he heard the loud bassoon\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A section of clothing covering the breast area\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"The figurative seat of the emotions, feelings etc.; one\u0027s heart or innermost thoughts\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"She kindled hope in the \u0027\u0027breast\u0027\u0027 of all who heard her\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Shakespear\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"He has a loyal \u0027\u0027breast\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"The ventral portion of an animal\u0027s thorax\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"The robin has a red \u0027\u0027breast\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"A choice cut of poultry, especially chicken or turkey, taken from the bird’s breast; also a cut of meat from other animals, breast of mutton, veal, pork\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"Would you like \u0027\u0027breast\u0027\u0027 or wing\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"The front or forward part of anything\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"a chimney \u0027\u0027breast\u0027\u0027; a plough \u0027\u0027breast\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"Milto\", \"priority\":18},{\"upperType\":\"NOUN\", \"text\":\"Mountains on whose barren \u0027\u0027breast\u0027\u0027 / The labouring clouds do often rest\", \"priority\":19},{\"upperType\":\"NOUN\", \"text\":\"date\u003d7 April passage\u003dIf you burn wood on its own, the flue gases are cooler than from a coal fire. This can result in tars condensing out within the parging and brickwork of the flue, sometimes causing brown or yellow staining on upstairs chimney \u0027\u0027breasts\", \"priority\":20},{\"upperType\":\"NOUN\", \"text\":\"The face of a coal working\", \"priority\":21},{\"upperType\":\"NOUN\", \"text\":\"The front of a furnace\", \"priority\":22},{\"upperType\":\"NOUN\", \"text\":\"The power of singing; a musical voice\", \"priority\":23},{\"upperType\":\"NOUN\", \"text\":\"Shakespear\", \"priority\":24},{\"upperType\":\"NOUN\", \"text\":\"By my troth, the fool has an excellent \u0027\u0027breast\", \"priority\":25}]}, \"synonyms\":{}}");

	add("breastapo", "{\"term\":\"breastapo\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{blend|breast|Gestapo|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Overzealous lactivists who pressure women to breastfeed and guilt formula-feeders taken as a group\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2011\u0027\u0027, Anna Maxted, \u0026quot;[http://www.telegraph.co.uk/health/children_shealth/8505493/Breastfeeding-Protect-us-from-the-Breastapo.html Breastfeeding: Protect us from the Breastapo]\u0026quot;, \u0027The Telegraph\u0027, 11 May 2011\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"In that vulnerable post-natal daze, brainwashed by the NCT and other hard-line members of the \u0027\u0027Breastapo\u0027\u0027, I almost believed it was better to starve my son than pollute him with formula\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2011\u0027\u0027, Emma Cowing, \u0026quot;[http://www.scotsman.com/news/emma-cowing-the-breastapo-need-to-lay-down-their-arms-1-1701366 The \u0027Breastapo\u0027 need to lay down their arms]\u0026quot;, \u0027The Scotsman\u0027, 21 June 2011\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Not all women can produce enough milk to feed their babies, and many push themselves to the brink of sanity in the attempt to do so, partly because of the pressure piled on to them by the \u0027\u0027Breastapo\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2013\u0027\u0027, Jen Wight, \u0027Day 6: When Motherhood \u0026amp; Madness Collide\u0027, Green Olive Press (2013), ISBN 9780987209979, [http://books.google.com/books?id\u003dN7BsAgAAQBAJ\u0026amp;pg\u003dPT47\u0026amp;dq\u003d%22breastapo%22 unnumbered page\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"I\u0027d heard about the \u0027\u0027Breastapo\u0027\u0027 but hadn\u0027t encountered a member yet. These are midwives and nurses whose keenness on breastfeeding somewhat overwhelms their ability to be kind and considerate\", \"priority\":7}]}, \"synonyms\":{}}");

	add("breastfeeding", "{\"term\":\"breastfeeding\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The activity of feeding a baby or young child milk from the breast of a lactating woman\", \"priority\":1}]}, \"synonyms\":{}}");

	add("breastwork", "{\"term\":\"breastwork\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|breast|work|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A fortification consisting of a breast-high bulwark; a parapet\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1983\u0027\u0027, Richard J. Hargrove, \u0027General John Burgoyne\u0027 (page 26\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A cannonproof \u0027\u0027breastwork\u0027\u0027, built during the previous war, extended along the beach from the hills to the rocks\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A railing on the quarter-deck and forecastle\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A parapet\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1922\u0027\u0027, w:Ulysses Ulysses Episode\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A swarthy boy opened a book and propped it nimbly under the \u0027\u0027breastwork\u0027\u0027 of his satchel. He recited jerks of verse with odd glances at the text: \u0026lt;!-- This is just a metaphor --\u0026gt\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"breast Breast augmentation\", \"priority\":8}]}, \"synonyms\":{}}");

	add("breath", "{\"term\":\"breath\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"old english (ca. 450-1100)\", \"German\", \"English\", \"middle english (1100-1500)\", \"Icelandic\", \"scots\"], \"text\":\"From Middle english (1100-1500) \u0027breeth\u0027 \u0027breth\u0027 from Old english (ca. 450-1100) {{m|ang|brǣþ||odor, scent, stink, exhalation, vapor}}, from Proto-germanic {{m|gem-pro|*brēþiz||vapour, waft, exhalation, breath}}, from Proto-indo-european {{m|ine-pro|*bʰrē-t-||exhalation from heat; steam}}, from Proto-indo-european {{m|ine-pro|*bʰer-||to seethe, toss about, cook}}. Cognate with Scots \u0027breth\u0027 \u0027breith\u0027 (breath) German \u0027brodem\u0027 (steam, vapour, fume, odour) Related also to Icelandic \u0027bráður\u0027 (hasty, hurried, excited, rash) More at {{l/en|brath}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act or process of breathing\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Breezes blowing from beds of iris quickened her \u0027\u0027breath\u0027\u0027 with their perfume; she saw the tufted lilacs sway in the wind, and the streamers of mauve-tinted wistaria swinging, all a-glisten with golden bees; she saw a crimson cardinal winging through the foliage, and amorous tanagers flashing like scarlet flames athwart the pines\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A single act of breathing in or out\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Serene, smiling, enigmatic, she faced him with no fear whatever showing in her dark eyes.She put back a truant curl from her forehead where it had sought egress to the world, and looked him full in the face now, drawing a deep \u0027\u0027breath\u0027\u0027 which caused the round of her bosom to lift the lace at her throat\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"She knew from avalanche safety courses that outstretched hands might puncture the ice surface and alert rescuers. She knew that if victims ended up buried under the snow, cupped hands in front of the face could provide a small pocket of air for the mouth and nose. Without it, the first \u0027\u0027breaths\u0027\u0027 could create a suffocating ice mask\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Air expelled from the lungs\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A rest or pause\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A small amount of something, such as wind, or common sense\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Fragrance; exhalation; odor; perfume\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"1561-1626\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"the \u0027\u0027breath\u0027\u0027 of flower\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"Gentle exercise, causing a quicker respiration\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"c.1564–1616\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"an after dinner\u0027s \u0027\u0027breath\", \"priority\":14}]}, \"synonyms\":{}}");

	add("breatharian", "{\"term\":\"breatharian\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|breath|arian|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who lives without food, subsisting instead on prana or sunlight\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"url \u003d http://www.nytimes.com/2005/02/06/nyregion/thecity/06brea.html passage \u003d Those who suspect a growing homogeneity in the once-eccentric East Village may find comfort in Dr. David Jubb, a New Age health guru who runs Jubb\u0027s Longevity on East 12th Street and claims to be a \u0027\u0027breatharian\u0027\u0027, taking light and air as his primary nourishment\", \"priority\":2}]}, \"synonyms\":{}}");

	add("breatharianism", "{\"term\":\"breatharianism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The belief in, or practice of, living without food, subsisting instead on prana or sunlight\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"magazine \u003d Jay\u0027s Journal of Anomalies volume \u003d 4 issue \u003d 1 passage \u003d An exponent of \u0027\u0027Breatharianism\u0027\u0027 named Wiley Brooks, a handsome, very thin black man in his forties, headed the Breatharian Institute of America, and in 1983 claimed not to have consumed anything except an occasional glass of fruit juice for eighteen years\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"url \u003d http://www.dailymail.co.uk/news/article-2135324/Woman-starves-death-spiritual-journey-trying-live-sunlight-alone.html passage \u003d Followers of the cult \u0027\u0027Breatharianism\u0027\u0027 believe that the energy they save on digesting food and drink can be transformed into physical, emotional and spiritual energy\", \"priority\":3}]}, \"synonyms\":{}}");

	add("breather", "{\"term\":\"breather\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Something or someone that breathes\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A short break; a rest or respite\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"After a short \u0027\u0027breather\u0027\u0027 she was ready to continue up the hill\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A spatially localized, time-periodic excitation in a one-dimensional lattice\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"That which puts one out of breath, such as violent exercise\", \"priority\":5}]}, \"synonyms\":{}}");

	add("breathlessness", "{\"term\":\"breathlessness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|breathless|ness|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state of being breathless or out of breath\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Difficult or labored respiration, dyspnea, shortness of breath\", \"priority\":2}]}, \"synonyms\":{}}");

	add("breathplay", "{\"term\":\"breathplay\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|breath|play|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Erotic asphyxiation; a sexual practice involving the intentional deprivation of oxygen to the brain by choking, hanging, or other means\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"engaged in with no problem at all\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"2013\u0027\u0027, Lewis Call, \u0027BDSM in American Science Fiction and Fantasy\u0027, Palgrave (2013), ISBN 9781137283474, [https://books.google.com/books?id\u003dHCEruC0GqsEC\u0026amp;pg\u003dPA25\u0026amp;dq\u003d%22breathplay%22 page 25\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"It even includes the consensual \u0027\u0027breathplay\u0027\u0027 of faith (Juliette Lewis) and Max Peltier (Tom Sizemore) in \u0027Strange Days\u0027: Peltier\u0027s meta-sadistic crimes notwithstanding, he gave Faith only what she desired, and afterwards her eyes glittered \u0026quot;with sated lust\u0026quot; (Cameron and Cocks 1993\", \"priority\":4}]}, \"synonyms\":{}}");

	add("breccia", "{\"term\":\"breccia\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Proto-Germanic\"], \"text\":\"{{borrowing|it|breccia|lang\u003den}}, from Proto-germanic\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A rock composed of angular fragments in a matrix that may be of a similar or a different material\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027, \u0027The Earth\u0027, Folio Society 2011, p. 24\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Courses of angular boulders line the rim of the volcano, the remains of its last explosive phase, resulting in a volcanic \u0027\u0027\u0027breccia\", \"priority\":3}]}, \"synonyms\":{}}");

