	add("breeches", "{\"term\":\"breeches\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"English\", \"middle english (1100-1500)\"], \"text\":\"Middle english (1100-1500) \u0027brech\u0027 \u0027brek\u0027 Old english (ca. 450-1100) {{m|ang|brēc}}, plural of {{m|ang|brōc||breech, breeches}}; akin to Old Norse \u0027brók\u0027 (breeches) Danish \u0027brog\u0027 Dutch \u0027broek\u0027 German \u0027bruch\u0027 {{g|f}}; compare Latin \u0027bracae\u0027 ( \u0026gt; French \u0027braies\u0027 which is of Celtic origin. Compare \u0027\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A garment worn by men, covering the hips and thighs; smallclothes\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1829\u0027\u0027, Samuel Taylor Coleridge and Robert Southey, \u0026quot;The Devil\u0027s Thoughts,\u0026quot\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"And how then was the Devil drest\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Oh! he was in his Sunday\u0027s best\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"His jacket was red and his \u0027\u0027breeches\u0027\u0027 were blue\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"And there was a hole where the tail came through\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Trousers; pantaloons; britches\", \"priority\":7}]}, \"synonyms\":{}}");

