	add("brevier", "{\"term\":\"brevier\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\", \"anglo-norman\"], \"text\":\"Probably from Old french (842-ca. 1400) or Anglo-norman {{m|fro|*brevier}}, from Latin {{m|la|breviārium||breviary}}, presumably from its use in printing them. Most brevaries were not, however, printed with such small type, leading some to conjecture that it instead derived from cognates of brief and has a meaning similar to French \u0027petit\u0027 and German \u0027petit\u0027 \u0026lt;ref\u0026gt;\u0027Oxford English Dictionary\u0027, 1st\u0026amp;nbsp;ed. \u0026quot;brevier, \u0027n.\u0027\u0026quot; Oxford University Press (Oxford), 1888.\u0026lt;/ref\u0026gt;\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The size of type between minion and bourgeois, standardized as 8-point\", \"priority\":1}]}, \"synonyms\":{}}");

